import React from "react";

class MessageCard extends React.Component {
  render() {
    return (
      <div className="message-card">
        <div
          className={
            this.props.username === this.props.author
              ? "card-right"
              : "card-left"
          }
        >
          {this.props.username}: {this.props.message}
        </div>
      </div>
    );
  }
}

export default MessageCard;
